script: |
  super -f text -I q5690.spq | sort > q5690.out

inputs:
  - name: q5690.spq
    data: |
      SELECT DISTINCT + 92 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet), tab2 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q5690.out
    data: |
      92
